// src/components/Header.js
import React from 'react';
import { Link } from 'react-router-dom';
import './Header.css';

function Header() {
  return (
    <header className="header">
      <div className="header-left">
      </div>
      <nav className="header-right">
        <Link to="/theidea" className="nav-button">The Idea</Link>
        <Link to="/thewhy" className="nav-button">The Why</Link>
        <Link to="/thecreator" className="nav-button">The Founders</Link>
      </nav>
    </header>
  );
}

export default Header;
